import React from 'react';
import {connect} from "react-redux";

const Player1 = props => {
        return (
            <div>
                <p>Player 1: {props.name1}</p>
            </div>
        );
};

const mapStateToProps = (state) => ({
    name2: state.name2
});

export default connect(mapStateToProps)(Player1);
